✨
One night after work I saw our apprentice yoga teacher (I called him Baba) at the gas station. He called me over to sit with him. I did and we talked for about ten minutes. I was surprised he even knew who I was because I was so shy and never really spoke with him before. Then he pulled out this silver bracelet and said he wanted me to have it. And proceeded to tell me about the importance of the number 108. 
💫
The next day I heard he passed away. This bracelet has always been so special to me. I will never forget our little random meetup. Or was it random?
😄
"In yoga, the number 108 refers to spiritual completion. It is why japa malas are composed of 108 beads, why pranayama is often completed in cycles of 108, and why sun salutations are often performed in nine rounds of the 12 postures (totaling 108)"
🌞
"The silver bracelet acts as a reminder that a Sikh should not do anything of which the Guru would not approve. A symbol of God having no beginning or end." -theyogajournal
